    if mibBuilder.loadTexts: alcatelIND1MVRPMIB.setRevisionsDescriptions(('Fixed the Notifications to use MIB Module OID.0 as Notifications root.', 'The MVRP MIB defines a set of MVRP related management objects for VLANs and ports that support Multiple VLAN Registration Protocol (MVRP). MVRP as a protocol provides mechanisms to dynamically learn and further propagate VLAN membership information across a bridged network, as recommended in standards IEEE Std. 802.1ak-2007, which is an amendment to IEEE Std 802.1Q-2005 Edition. This MVRP MIB extends already existing IETF_Q_BRIDGE MIB which is based on RFC 2674 (Bridges with Traffic Classes, Multicast Filtering and Virtual LAN Extensions), to accomodate the proprietary behavior of the device and for defining objects as recommended by standards. This MIB comprises proprietary managed objects as well the objects required for conforming to the standards. However, the set of objects defined in this MIB, do not duplicate, nor conflict with any MIB object definitions defined in the IETF_Q_BRIDGE_MIB.',))
