class MvrpPortVlanRestrictBitmap(TextualConvention, Bits):
    description = "The bitmap that includes the status value for different type of restrictions that could be applied for a port VLAN combination. Each bit in the bitmap corresponds to the status of the restriction applied for a VLAN on a port. Having the bit 'noRestriction(0)' set indicates that the no restriction is applied for the VLAN on the port. No other option can be applied along with this option. Having the bit 'restrictRegistration(1)' set indicates that the VLAN is restricted from getting registered on the port. Having the bit 'restrictAdvertisement(2)' set indicates that the advertisement for the VLAN is restricted on the port. Having the bit 'restrictStaticVlanRegistration(3)' set indicates that the registration on a port for a static VLAN is restricted."
    status = 'current'
    namedValues = NamedValues(("noRestriction", 0), ("restrictRegistration", 1), ("restrictAdvertisement", 2), ("restrictStaticVlanRegistration", 3))

